import React, { Component } from "react";
import { connect } from "react-redux";
import classnames from "classnames";
import { Link } from "react-router-dom";
import {
  getProfileTask,
  updateProfileTask
} from "../../../actions/profileBacklogActions";
import PropTypes from "prop-types";
import NumericInput from "react-numeric-input";

class UpdateProfileTask extends Component {
  constructor() {
    super();

    this.state = {
      id: "",
      profileSequence: "",
      summary: "",
      acceptanceCriteria: "",
      status: "",
      totalYears: "",
      priority: "",
      dueDate: "",
      profileIdentifier: "",
      create_At: "",
      errors: {}
    };
    this.onChange = this.onChange.bind(this);
    this.onSubmit = this.onSubmit.bind(this);
  }

  componentDidMount() {
    const { backlog_id, pt_id } = this.props.match.params;
    this.props.getProfileTask(backlog_id, pt_id, this.props.history);
  }

  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({ errors: nextProps.errors });
    }

    const {
      id,
      profileSequence,
      summary,
      acceptanceCriteria,
      status,
      totalYears,
      priority,
      dueDate,
      profileIdentifier,
      create_At
    } = nextProps.profile_task;

    this.setState({
      id,
      profileSequence,
      summary,
      acceptanceCriteria,
      status,
      totalYears,
      priority,
      dueDate,
      profileIdentifier,
      create_At
    });
  }

  onChange(e) {
    this.setState({ [e.target.name]: e.target.value });
  }

  onSubmit(e) {
    e.preventDefault();

    const UpdateProfileTask = {
      id: this.state.id,
      profileSequence: this.state.profileSequence,
      summary: this.state.summary,
      acceptanceCriteria: this.state.acceptanceCriteria,
      status: this.state.status,
      totalYears: this.state.totalYears,
      priority: this.state.priority,
      dueDate: this.state.dueDate,
      profileIdentifier: this.state.profileIdentifier,
      create_At: this.state.create_At
    };

    // console.log(UpdateProfileTask);
    this.props.updateProfileTask(
      this.state.profileIdentifier,
      this.state.profileSequence,
      UpdateProfileTask,
      this.props.history
    );
  }

  render() {
    const { errors } = this.state;
    return (
      <div className="add-PBI">
        <div className="container">
          <div className="row">
            <div className="col-md-8 m-auto">
              <Link
                to={`/profileBoard/${this.state.profileIdentifier}`}
                className="btn btn-light"
              >
                Back to Profile Board
              </Link>
              <h4 className="display-4 text-center">Update Profile Task</h4>
              <p className="lead text-center">
                Profile Name: {this.state.profileIdentifier} | Profile Task ID:{" "}
                {this.state.profileSequence}{" "}
              </p>
              <form onSubmit={this.onSubmit}>
                <h6>Competences:</h6>
                <div className="form-group">
                  <input
                    type="text"
                    className={classnames("form-control form-control-lg", {
                      "is-invalid": errors.summary
                    })}
                    name="summary"
                    placeholder="Profile Task summary"
                    value={this.state.summary}
                    onChange={this.onChange}
                  />
                  {errors.summary && (
                    <div className="invalid-feedback">{errors.summary}</div>
                  )}
                </div>
                <h6>Total of Years:</h6>
                <NumericInput
                  mobile
                  min={0}
                  max={50}
                  className="form-control"
                  name="totalYears"
                  onChange={this.onChangeText}
                  value={this.state.totalYears}
                />
                <h6>Total of Years</h6>
                <input
                  type="submit"
                  className="btn btn-primary btn-block mt-4"
                />
              </form>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

UpdateProfileTask.propTypes = {
  getProfileTask: PropTypes.func.isRequired,
  profile_task: PropTypes.object.isRequired,
  updateProfileTask: PropTypes.func.isRequired,
  errors: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  profile_task: state.backlog.profile_task,
  errors: state.errors
});

export default connect(
  mapStateToProps,
  { getProfileTask, updateProfileTask }
)(UpdateProfileTask);
